    false,nt"url": null,nt"notes": "Information about the history and management
    of Lake Andes is compiled in this report. It is intended to help future refuge managers
    become acquainted with the facts about Lake Andes and its operations. The lake became
    property of the United States government in 1858 and then became a refuge in 1936.
    Water management since that time is discussed in this report. Legal documents, articles,
    Executive Orders, construction proposals, correspondence, water rights applications,
    a soil report, maps, management reports and plans, and a lead shot study are included.",nt"license_title":
